pragma solidity >=0.5.1;
pragma experimental ABIEncoderV2;
import './verifier.sol';

contract squareVeri is Verifier{
    bool public success = false;
    function verifyzok(
            Proof memory proof, 
            uint[2] memory input) public returns (bool) {
            success = verifyTx(proof, input);
            if (success) {
                return true;
            }else {
                return false;
            }
        }
        
}
